import React from "react";
import "./app-header.css"
const AppHeader = () =>{

    return(
        <div className="header">
            <div className="header_items">
                <div className="header_items_first"></div>
                <div className="app-header d-flex header_items_second">
                    <h1>My Todo List</h1>
                    <h2>1 more to do, 3 done</h2>
                </div>
                <div className="header_items_third"></div>

            </div>


        </div>


    )
}

export default AppHeader;
